    //     // this.setState((prevState, props) => ({ AssetNames: item["Name of Asset"], ...prevState.AssetNames }))
    //     this.setState({
    //       monetoryValues: [
    //         ...this.state.monetoryValues, item["Monetary Value"]
    //       ],
    //     });
    //     this.setState({
