    //       ],
    //     });


    //   })
    // }
    // console.log("monetoryValues", this.state.monetoryValues, this.state.AssetNames)

  }

  async deletePost(id) {
    console.log(id);
    swal({
      title: "Are you sure?",
      text: "You want to delete this message.",
      icon: "warning",
      buttons: true,
      dangerMode: true,
